import "./App.css";
// import Nav from "./Nav.js";
import Photo from "../src/Components/Photo.js";
import Name from "../src/Components/Name.js";
import Options from "../src/Components/Options.js";
import { useState } from "react";

const [count, setCount] = useState(0);

function Lettuse(props) {
  return (
    <div className="friend-Container">
      <Photo onClick={() => setCount(count + 1)} />
      <Name name={props.name} />
      <Options />
    </div>
  );
}

function App() {
  return (
    <section>
      <Lettuse name="Ruslan Karaneuski" />
      <Lettuse name="Leonardo Davinci" />
      <Lettuse name="Fox Bernad" />
      <Lettuse name="Traxar Daszy ❤️" />
    </section>
  );
}

export default App;
